import React, { useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, useNavigate } from 'react-router-dom';

const App = () => (
    <div className="App">
        <Routes>
          <Route index element={<h3>Hello Index !!!</h3>} />
          <Route path="/table" element={<h1>Hello Table</h1>} />
        </Routes>
    </div>
);
